import React from 'react';
import styles from '../styles/header_styles.css';
import { Link } from 'react-router-link';
import ReactDOM from 'react-dom';
import Navbar from 'react-bootstrap/Navbar';
import { Nav, NavItem, NavLink, NavDropdown, Form, FormControl, Button } from 'reactstrap';

function HeaderComponent() {

    return (
        <div className="HeaderComponent">

        <div class="button"  style={hyperlinkContainer}>
        <a href="#" onclick="console.log('The link was clicked.'); return false" 
        style={hyperlink}> <span >Hi</span>
            </a>
            </div>

            <Navbar bg="light" expand="lg">
  <Navbar.Brand href="#home">React-Bootstrap</Navbar.Brand>
  <Navbar.Toggle aria-controls="basic-navbar-nav" />
  <Navbar.Collapse id="basic-navbar-nav">
    <Nav className="mr-auto">
      <Nav.Link href="#home">Home</Nav.Link>
      <Nav.Link href="#link">Link</Nav.Link>
      <NavDropdown title="Dropdown" id="basic-nav-dropdown">
        <NavDropdown.Item href="#action/3.1">Action</NavDropdown.Item>
        <NavDropdown.Item href="#action/3.2">Another action</NavDropdown.Item>
        <NavDropdown.Item href="#action/3.3">Something</NavDropdown.Item>
        <NavDropdown.Divider />
        <NavDropdown.Item href="#action/3.4">Separated link</NavDropdown.Item>
      </NavDropdown>
    </Nav>
    <Form inline>
      <FormControl type="text" placeholder="Search" className="mr-sm-2" />
      <Button variant="outline-success">Search</Button>
    </Form>
  </Navbar.Collapse>
</Navbar>
        </div>

    )
}

const hyperlink = {
    position: 'absolute', 
    top: '50%', 
    left: '50%',
    color: 'white'
};

const hyperlinkContainer = {
    position: 'absolute',
    top: '3%',
    right: '10%'
}

export default HeaderComponent;
